import { useForm } from 'react-hook-form';

export default function Register() {
  const { register, handleSubmit, formState: { errors } } = useForm({
    defaultValues: {
      firstName: '',
      lastName: ''
    }
  });

  const onSubmit = data => console.log(data);



  return (
    <>
    <form onSubmit={handleSubmit(onSubmit)}>
      <div className="name-row">
      <input 
        {...register("firstName", {
        required: true,
        minLength: 2,
        maxLength: 16,
        })}
        name="firstName"
        type="text"
      />
      <input 
        {...register("lastName", {
        required: true,
        minLength: {
          value: 2,
          message: "Too short"
        },
        maxLength: {
          value: 16,
          message: "Too long"
        }
        })}
        name="lastName"
        type="text"
      />
      </div>
      {errors.firstName?.type === "required" && <span>Enter first name</span>}
      {errors.lastName?.type === "required" && <span>Enter last name</span>}
      {errors.lastName?.minLength && <span>Too short</span>}
      {errors.lastName?.maxLength && <span>Too long</span>}


      <input type="submit"/>
    </form>
    </>
  )
}
